import "../css/NavUp.css";

const NavUp = () => {
    return (
        <>
      <div className="login-nav col-12">
        <div className="m-banner">
          <p>
            The Together Mode and Large Gallery View features are rolling out to
            customers now.
          </p>
        </div>
      </div>
        </>
    )
}

export default NavUp;
